INSERT INTO `freecomett_projects` VALUES (1,'FreeBMD','FreeBMD is an ongoing project, the aim of which is to transcribe the Civil Registration index of births, marriages and deaths for England and Wales, and to provide free Internet access to the transcribed records.','Icons','freebmd.svg','https://images.freebmd.org.uk','https://www.freebmd.org.uk/cgi/bmd-files.pl','https://test1.freebmd.org.uk/cgi/bmd-files.pl/','Open','2023-02-05 16:57:25'),(2,'FreeREG','The aim of FreeREG is to provide free internet searches of baptism, marriage, and burial records. We are transcribing records from parish registers, non-conformist records and other relevant sources in the UK.','Icons','freereg.svg',NULL,NULL,NULL,'Open','2023-02-05 16:57:38'),(3,'FreeCEN','The aim of FreeCEN is to provide free internet searches of the 19th century UK census returns. The first UK census to include names and other details of UK residents took place in 1841. Since then, a census has been held every ten years.','Icons','freecen.svg',NULL,NULL,NULL,'Open','2023-02-05 16:48:58');
